Entreprenør til spændende projekter søges
<p>Er du en erfaren <a href="https://www.ug.dk/job/job-fordelt-paa-erhvervsomraader/egenvirksomhed/uddannelse-i-entreprenoerskab">entreprenør</a> med solid baggrund i branchen, og ønsker du at være en del af en virksomhed, hvor sikkerhed og trivsel går hånd i hånd med <a href="https://ordnet.dk/ddo/ordbog?query=kvalitet">kvalitet</a> og udvikling? Så er dette muligheden for dig!</p>


&nbsp;
&nbsp;


&nbsp;


Om jobbet:


&nbsp;
&nbsp;


&nbsp;


<p>Vi søger en engageret og dygtig entreprenør til en hverdag fyldt med alsidige og udfordrende opgaver. Du vil blive en del af en entreprenørafdeling i rivende udvikling, hvor dine kompetencer bliver sat i spil inden for <a href="https://ordnet.dk/ddo/ordbog?query=fejls%C3%B8gning">fejlsøgning</a>, nedgravning af kabler og planlægning samt udførelse af større <a href="https://ordnet.dk/ddo/ordbog?query=projekter">projekter</a>.</p>


&nbsp;
&nbsp;


&nbsp;


Vi leder efter dig, der:


&nbsp;
&nbsp;


&nbsp;


<ul>
<li>Har stor erfaring og stærke faglige kompetencer inden for <a href="https://ordnet.dk/ddo/ordbog?query=entrepren%C3%B8r">entreprenørarbejde</a>.</li>
<li>Kan arbejde selvstændigt og ansvarligt, med evnen til at tage initiativ og træffe beslutninger.</li>
<li>Er fleksibel og serviceorienteret med en positiv indstilling til nye opgaver og kundeønsker.</li>
<li>Behersker dansk, både mundtligt og skriftligt.</li>
<li>Kan fremvise <a href="https://www.borger.dk/Handlingsside?selfserviceId=862067d1-74e0-4109-8a28-01a994310049">straffeattest</a>.</li>
</ul>


&nbsp;
&nbsp;


&nbsp;


Hvad vi tilbyder:


&nbsp;
&nbsp;


&nbsp;


<ul>
<li>Mødetid fra 7-15, eller efter aftale.</li>
<li>Et stærkt og støttende <a href="https://at.dk/">arbejdsmiljø</a> med dygtige og hjælpsomme kollegaer, der altid er klar til sparring.</li>
<li><a href="https://ordnet.dk/ddo/ordbog?query=l%C3%B8n">Løn</a> efter kvalifikationer, så din erfaring bliver værdsat.</li>
<li>En sund og positiv arbejdsplads med fokus på trivsel og sikkerhed.</li>
<li>arbejde med spændende opgaver i en professionel atmosfære.</li>
</ul>


&nbsp;
&nbsp;


&nbsp;


<p>Vil du være en del af en <a href="https://lubitransport.dk/">dynamisk arbejdsplads</a>, hvor der er fokus på kvalitet, samarbejde og udvikling? Så send os din ansøgning og <a href="https://lubijob.dk/ledige-stillinger/">CV</a> allerede i dag.</p>
<p>Vi ser frem til at høre fra dig!</p>
